import React, { Component } from 'react'
import Check from '../images/icons/check.png'
import Location from '../images/icons/check.png'
import Phone from '../images/icons/check.png'
import Time from '../images/icons/check.png'



class IconBar extends Component {
  render() {
    return (
      <div className="iconbar">
        <img src={Check} />
      </div>
    )
  }
}

export default IconBar
